import React, { component } from 'react';
import "./Home.css";

class Home extends React.Component {
    render() {
        return (
            <div className='homeContainer'>
                <div className="header-text">
                    <h1>Welcome to my Portfolio</h1>
                </div>

            </div>
        )
    }
}
export default Home;
